Agora podemos entender melhor o que Mussolini, Hitler e o integralista Plinio Salgado dizia sobre o modelo de Deus, Pátria e Família, os valores sagrados dos livros sagrados não valem mais nada se julgarmos a fala desse elemento. Do ponto de vista legal nem vale a pena citar nada, é uma atrocidade vil. dolf Hitler chegou ao poder por meio legal (democrático), a Alemanha naquela época era uma Democracia Liberal (República de Weimar), com pesado e insistente discurso melhorado pela máquina propagandista nazista ele inseriu um culto ao mito da personalidade ligada a sua pessoa, assim elevando seus ideais nazistas da extrema direita.

Em resumo seguiu uma cartilha de domínio pelo convencimento realizada pela difusão maciça de mentiras (fake news) que eram pouco combatidas, pois o moral da sociedade estava baixo após um grave trauma sociológico, isso fez com que a sociedade alemã fosse convencida por uma personalidade e o ultra nacionalista extremo.

Com as portas da democracia aberta e já inserido no governo seu congresso foi cooptado primeiro em razão da sedução da retórica e segundo pelo acesso as cadeiras no parlamento que logo seriam dominadas, compradas e destruídas para a Alemanha democrática ser tomada de assalto diante de todos os olhos e sobre a luz da legalidade (da porta da frente). 

Assim você conhece parte da história daquele que dizia absurdos que ninguém ligava mas, pelo sistema de comunicação das massas "os idiotas" ganharam vozes e obtiveram êxito no convencimento. Motivados colocaram o absurdo falado em prática e o resto da história todos nós conhecemos até chegar o fim do Muro de Berlim , um símbolo histórico que representa a materialização de todo mal que o mundo sofreu, especialmente a Europa.

Se você leu até aqui se pergunta como pode um Estado bem desenvolvido e um polo de sólida cultura ter caído num discurso raso para a Banalidade do Mal como foi o NAZISMO e suas consequências?!

Simples, isso tem método em hoje (2022) vivemos a mesma situação, se dúvidas fica o desafio para compreender os processos históricos, sociológico e jurídicos de alguns países que sobre esse ataque por meio da comunicação das massas pautada em mentiras, logicamente a mesma comunicação impede o avanço do mal em alta velocidade, contudo não tem forças de pará-lo, pois a mentira é cômoda, afinal a preguiça ou falta de acesso faz que o homem médio não faça as devidas checagens do que lê e  do que compartilha.

Considerando a lógica e os fatos históricos as DEMOCRACIAS ACABAM não importa a ideologia local, mas o método e o resultado atingido serão os mesmos, ou seja, a DITADURA branca por meio da própria democracia.

Como assim? - Basta haver apenas um autocrata de plantão que teve algum sucesso em chegar a presidência da república, assim temos em tempos atuais os seguintes países para verificarmos os fatos (não é tese, É FATO!), e, como esses passos ocorreram, verifiquem a história:

- Venezuela;
- Hungria;
- Polônia;
- Turquia; e 
- Russia !

Mas como as democracias acabam? E como isso pode acontecer no Brasil, simples, há estudos que resumem a isso:

"Parafraseando as fases de uma ruptura da democracia, temos:
1- Inércia: Instituições agem de forma branda frente ao golpista e a sociedade fica somente com o inconformismo sem tomar as ruas para se manifestar; 
2- Censura: Os meios de comunicação são difamados, desacreditados, suportam assédio policial e judicial, em ato contínuo são manipulados ardilosamente pela técnica de pós verdade, logo após existirá a figura do censor;  
3- Fuga: Sociedade detentora de conhecimentos e meios ansiosamente começam a sair do País;
4- Prisões: Os opositores políticos começam a ser presos, logo após sua militância ou qualquer pessoa, artista, intelectual que não concorde com o novo regime de exceção, abre-se portanto lacuna contra crimes fúteis e torpes contra qualquer cidadão com ou sem razão; 
5- Exílio: Inicia-se diante da grande repercussão internacional a expatriação forçada de pessoas que tem grande visibilidade ou de figuras do item 4;
6- Resistência: Com insuportável grau de sofrimento físico e mental inaugura-se desorganizadamente atos de revolta e pequenos atendados contra as forças golpistas, com maior rigor na resposta haverão aumento de prisões, torturas e mortes, no segundo estágio o sofrimento alimentado pela esperança e ódio ao estado de exceção as forças de resistência ganha forma e contorno com o advento intelectual e de meios materiais e imateriais de origem nacional ou estrangeira ganha forma e forma-se a insurgência, grupos de guerrilha e grupos terroristas organizados para repelir.

Resumindo não há ganho algum para a sociedade, só resta a dor e a morte que certamente resultarão em décadas de miséria, instabilidades econômicas e sociais, o único que ganha é o golpista e seus asseclas.  LUTTWAK, Edward. Coup d’Estad: A Practical Handbook. (2016)."
